import React from 'react';
import Link from 'next/link';

//페이지 6개 + 기능 2개 +
const Nav = () => {
    return (
        <div>
            <Link href="/">
                <a>홈 버튼</a>
            </Link>
            <Link href="/msg">
                <a>메세지 버튼</a>
            </Link>
            <Link href="/notice">
                <a>공지사항</a>
            </Link>
            <Link href="/schedule">
                <a>업무일정</a>
            </Link>
            <Link>
                <a href="meeting-reserve">회의실예약</a>
            </Link>
            {/*
            기능 2개 
            <Link>
                <a href>업무시작</a>
            </Link>
            <Link>
                <a>업무종료</a>
            </Link> 
            */}
        </div>
    );
};

export default Nav;
